import React from "react";

const UserList = (props) => {
let userCardsContent = <p>No cards added yet.</p>
    if (props.dataToRender.length > 0) {
        userCardsContent = props.dataToRender.map((card) => (<li>{card.Username}({card.Age} years old)</li>))};

    return (
       <div> <ul>{ userCardsContent };</ul></div>
   );
};

export default UserList;
